import React from 'react';
import { Card, CardContent, Typography, Box, Grid, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import { BarChart } from '@mui/x-charts/BarChart';
import { LineChart } from '@mui/x-charts/LineChart';
import { PieChart } from '@mui/x-charts/PieChart';

const ProjectionsChart = () => {
  const data = [20, 35, 25, 45, 30, 40, 35, 50, 45, 35, 40, 30];
  const xLabels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];

  return (
    <Card>
      <CardContent sx={{ p: 3 }}>
        <Typography variant="h6" sx={{ mb: 3, fontWeight: 600 }}>
          Projections vs Actuals
        </Typography>
        <Box sx={{ height: 250 }}>
          <BarChart
            series={[{ data, color: '#3b82f6' }]}
            xAxis={[{ data: xLabels, scaleType: 'band' }]}
            height={250}
            margin={{ left: 40, right: 40, top: 40, bottom: 40 }}
          />
        </Box>
      </CardContent>
    </Card>
  );
};

const RevenueChart = () => {
  const currentWeek = [20, 25, 30, 35, 40, 45, 50, 55, 60, 65, 70, 75];
  const previousWeek = [15, 20, 25, 30, 35, 40, 45, 50, 55, 60, 65, 70];
  const xLabels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];

  return (
    <Card>
      <CardContent sx={{ p: 3 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
          <Typography variant="h6" sx={{ fontWeight: 600 }}>
            Revenue
          </Typography>
          <Box sx={{ display: 'flex', gap: 3 }}>
            <Box>
              <Typography variant="body2" color="text.secondary">
                Current Week
              </Typography>
              <Typography variant="body2" fontWeight={600}>
                $58,211
              </Typography>
            </Box>
            <Box>
              <Typography variant="body2" color="text.secondary">
                Previous Week
              </Typography>
              <Typography variant="body2" fontWeight={600}>
                $68,768
              </Typography>
            </Box>
          </Box>
        </Box>
        <Box sx={{ height: 250 }}>
          <LineChart
            series={[
              { data: currentWeek, color: '#3b82f6', label: 'Current Week' },
              { data: previousWeek, color: '#e5e7eb', label: 'Previous Week' },
            ]}
            xAxis={[{ data: xLabels, scaleType: 'band' }]}
            height={250}
            margin={{ left: 40, right: 40, top: 40, bottom: 40 }}
          />
        </Box>
      </CardContent>
    </Card>
  );
};

const LocationChart = () => {
  const data = [
    { id: 0, value: 72, label: 'New York', color: '#3b82f6' },
    { id: 1, value: 39, label: 'San Francisco', color: '#06b6d4' },
    { id: 2, value: 25, label: 'Sydney', color: '#8b5cf6' },
    { id: 3, value: 61, label: 'Singapore', color: '#10b981' },
  ];

  const locations = [
    { name: 'New York', value: '72K', percentage: '72%' },
    { name: 'San Francisco', value: '39K', percentage: '39%' },
    { name: 'Sydney', value: '25K', percentage: '25%' },
    { name: 'Singapore', value: '61K', percentage: '61%' },
  ];

  return (
    <Card>
      <CardContent sx={{ p: 3 }}>
        <Typography variant="h6" sx={{ mb: 3, fontWeight: 600 }}>
          Revenue by Location
        </Typography>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 3 }}>
          <Box sx={{ width: 150, height: 150 }}>
            <PieChart
              series={[
                {
                  data,
                  innerRadius: 30,
                  outerRadius: 75,
                  paddingAngle: 2,
                },
              ]}
              width={150}
              height={150}
            />
          </Box>
          <Box sx={{ flex: 1 }}>
            {locations.map((location, index) => (
              <Box
                key={index}
                sx={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'space-between',
                  mb: 1.5,
                }}
              >
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  <Box
                    sx={{
                      width: 12,
                      height: 12,
                      borderRadius: '50%',
                      backgroundColor: data[index].color,
                    }}
                  />
                  <Typography variant="body2" color="text.secondary">
                    {location.name}
                  </Typography>
                </Box>
                <Box sx={{ display: 'flex', gap: 2 }}>
                  <Typography variant="body2" fontWeight={500}>
                    {location.value}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    {location.percentage}
                  </Typography>
                </Box>
              </Box>
            ))}
          </Box>
        </Box>
      </CardContent>
    </Card>
  );
};

const TopProducts = () => {
  const products = [
    { name: 'ASOS Ridley High Waist', price: '$79.49', sold: 82, revenue: '$6,518.18' },
    { name: 'Marco Lightweight Shirt', price: '$128.50', sold: 37, revenue: '$4,754.50' },
    { name: 'Half Sleeve Shirt', price: '$39.99', sold: 64, revenue: '$2,559.36' },
